import React from 'react'
import { ReactCompareSlider, ReactCompareSliderImage } from 'react-compare-slider';
import imageOne from '../../../assets/nonUpscaledImage.jpg'
import imageTwo from '../../../assets/upscaledImage.jpg'

const UpscaleMarketingSlide = () => {
  return (
    <div>
      <ReactCompareSlider
        itemOne={<ReactCompareSliderImage src={imageOne} alt="Image one" />}
        itemTwo={<ReactCompareSliderImage src={imageTwo} alt="Image two" />}
        style={{
          width: '1200px',
          height: '500px',
          backgroundPosition: 'center center',
        }}
        className='rounded-xl'
      />
    </div>
  )
}

export default UpscaleMarketingSlide
